import React, { useState } from "react";
import Card from "react-bootstrap/Card";
import Modal from "react-bootstrap/Modal";
import Button from "react-bootstrap/Button";
import Cards from "./cards";

const Latest = (props) => {
  return (
    <div>
      <Cards img={props.img} />
    </div>
  );
};

export default Latest;
